import React, { useState } from 'react';

function Contacts() {
  let api = "http://127.0.0.1:8090/api/collections/contacts/records/";
  profiles = [];

fetch(api)
.then(response => response.json())
.then(data => {
    profiles = data.items;
    // getContacts(profiles);
});

  return (
    console.log(profiles)
  );
  };

export default Contacts;
